function maximumValueSum(board: number[][]): number {
    let cells = [];
    const n = board.length;
    const m = board[0].length;

    for (let i = 0; i < n; i++) {
        for (let j = 0; j < m; j++) {
            cells.push([i, j]);
        }
    }

    cells.sort(([i1, j1], [i2, j2]) => board[i2][j2] - board[i1][j1]);

    let ii = [], jj = [];
    for (let i = 0; i < cells.length; i++) {
        if (!ii.includes(cells[i][0])) {
            ii.push(cells[i][0]);
        }

        if (!jj.includes(cells[i][1])) {
            jj.push(cells[i][1]);
        }

        if (ii.length >= 5 && jj.length >= 5) {
            break;
        }
    }

    cells = cells.filter(([i, j]) => ii.includes(i) && jj.includes(j));

    let cell1, cell2, cell3;
    let max;

    for (let i1 = 0; i1 < cells.length; i1++) {
            const cell1 = cells[i1];

            for (let i2 = 0; i2 < cells.length; i2++) {
                    if (i2 === i1 || cell1[0] === cells[i2][0] || cell1[1] === cells[i2][1])
                        continue;

                    const cell2 = cells[i2];

                    for (let i3 = 0; i3 < cells.length; i3++) {
                            if (i3 === i1 || i3 === i2 || cell1[0] === cells[i3][0] || cell1[1] === cells[i3][1] || cell2[0] === cells[i3][0] || cell2[1] === cells[i3][1])
                                continue;

                            const cell3 = cells[i3];
                            const sum = board[cell1[0]][cell1[1]] + board[cell2[0]][cell2[1]] + board[cell3[0]][cell3[1]];

                            if (max === undefined || sum > max) {
                                max = sum;
                            }
                    }
        }
    }

    return max;
};
